import React from "react";
import NavBar from "./NavBar";
import UpComing from "./UpComing";

const Home = () => {
  return (
    (
      <div>
        <NavBar />
      </div>
    ),
    (
      <div>
        <UpComing />
      </div>
    )
  );
};

export default Home;
